class Solution:
    def max_subtree(self, A, B):
        """
        :type A: List[int]
        :type B: List[int]
        :rtype: int
        """

        def is_white(A, B, i):
            if A[i] == B[i]:
                return True
            if A[i] > B[i]:
                return False
            else:
                return is_white(A, B, i+1)

        def is_black(A, B, i):
            if A[i] == B[i]:
                return True
            if A[i] < B[i]:
                return False
            else:
                return is_black(A, B, i+1)

        def min_subtree(A, B, i):
            if A[i] == B[i]:
                return A[i]
            if is_white(A, B, i):
                return min_subtree(A, B, i+1)
            else:
                return -1

        return max(min_subtree(A, B, i) for i in range(len(A)) if A[i]!= B[i])

