class Solution:
    def maxNumberOfFights(self, r: int, s: int, k: int) -> int:
        left = 0
        right = s - 1
        count = 0
        while right - left >= 1:
            mid = (left + right) // 2
            if self.check_left(mid, s, r) and self.check_right(mid, s, r):
                count += mid
                right = mid - 1
            else:
                left = mid
        return count

    def check_left(self, index: int, s: int, r: int) -> bool:
        if index >= r or index >= s:
            return False
        return True if s < r - index else False

    def check_right(self, index: int, s: int, r: int) -> bool:
        if index >= r or index >= s:
            return False
        return True if r < index - s else False


