        def build_diag_positions(rows: int, columns: int, start_index: int = 0) -> dict:
            ans = defaultdict(list)
            for row in range(rows):
                for col in range(columns):
                    ans[(start_index + row, start_index + col)].append(process(stdin[start_index + row][start_index + col]))
            return ans

        def fill_diag_positions(positions: dict):
            for key, value in positions.items():
                positions[key] = ''.join(sorted(value))
            return positions

        def sort_diag_positions(positions: dict):
            positions = {k: sorted(v) for k, v in positions.items()}
            return positions

        def shift_diag_positions(positions: dict):
            for key, value in positions.items():
                positions[key] = value[::-1]
            return positions

        def solution(rows: int, columns: int, max_steps: int) -> str:
            positions = build_diag_positions(rows, columns)
            positions = fill_diag_positions(positions)
            positions = sort_diag_positions(positions)
